import React from "react";
import { Category } from "./Category";
import { AiTwotoneCamera } from "react-icons/ai";
import { BsFillCameraVideoFill } from "react-icons/bs";
import { MdOutlineAudiotrack } from "react-icons/md";
import { HiDocumentDuplicate } from "react-icons/hi";

export const Categories = () => {
  const categories = [
    { name: "Pictures", files: 180, color: "blue", icon: AiTwotoneCamera },
    {
      name: "Documents",
      files: 20,
      color: "orange",
      icon: HiDocumentDuplicate,
    },
    { name: "Videos", files: 40, color: "cyan", icon: BsFillCameraVideoFill },
    { name: "Audio", files: 10, color: "green", icon: MdOutlineAudiotrack },
  ];

  return (
    <div className="flex flex-col gap-4">
      <h1 className="font-bodyFont text-3xl font-extrabold text-sky-950">
        Category
      </h1>
      <div className="flex gap-4">
        {categories.map((category) => (
          <Category category={category} icon={category.icon} />
        ))}
      </div>
    </div>
  );
};
